import React from "react";

class Leader extends React.Component {

  constructor(props){
    super(props)
  }

  render() {
    return (
      <div onClick={(e)=>this.handleUserClick(e)}
      name="rating">
        <a class="list-group-item google-plus" >
            <h3 class="pull-right">
                <i class="icon glyphicon glyphicon-fire"></i>
            </h3>
            <h4 class="list-group-item-heading count">{this.props.title}
            <h3></h3>

            </h4>
            <p class="list-group-item-text">{this.props.getUser?
              (this.props.getUser.rating):null}</p>
        </a>
      </div>
    )
  }
}
export default Leader
